INSERT IGNORE INTO `vans` (`van_id`, `org_id`, `model`, `capacity`, `description`, `price`) VALUES
	(1, 2, 'VOLKSWAGEN California T5', 5, 'Le van aménagé Volkswagen California T5 gamme Baroudeur vous surprendra par son confort et sa facilité d’utilisation. Avec ses 4 places assises et 4 couchages, idéal pour partir en road-trip afin des vivre des expériences en toute liberté !', 119),
	(3, 1, 'EXPLORER 5 Campereve Family 5', 5, 'Le van aménagé Campereve Family 5 est idéal pour les aventures en famille ou entre amis avec de l’espace grâce à ses 5 places assises et ses 3 lits confortables. Idéal pour partir en road-trip et explorer', 139),
	(4, 3, 'MERCEDES Marco Polo', 4, 'Le van aménagé Mercedes Marco Polo vous permettra de partir en road-trip sans négliger le confort. Avec ses 4 places assises et 4 couchages, vous bénéficierez d’un grand confort lors de vos nouvelles expériences outdoor.', 109),
	(5, 3, 'VOLKSWAGEN Caravelle EGOE', 4, 'Ce van aménagé Volkswagen Caravelle est confortable pour 2 personnes. Il offre un coffre volumineux. Il est possible de fixer une tente de toit pour le transformer en California.', 99),
	(6, 1, 'VOLKSWAGEN California Beach T6.1', 5, 'Le van aménagé Volkswagen California Beach est idéal pour combiner style et aventure avec VW. Il dispose de 5 couchages (2 adultes + 3 enfants) et 5 places assises.', 149),
	(7, 2, 'VOLKSWAGEN ID.Buzz', 5, 'Le 1er van 100% électrique pour entrer dans le présent et le futur ! Fais le plein d\'options et d\'innovation pour ton prochain road-trip sans consommer d\'essence ou diesel. Idéal pour un trip local en toute tranquillité.', 109),
	(8, 3, 'FORD Copa Bürstner', 4, 'Ce van aménagé Copa Bürstner propose un espace cuisine de qualité et des rangements extra (skis, planche de surf, etc.). Idéal pour ceux qui ne sont pas à l’aise pour conduire un “gros” van aménagé.', 119),
	(9, 1, 'VOLKSWAGEN Caddy California', 5, 'Ce mini van aménagé Volkswagen Caddy California offre un espace intérieur optimal pour un couchage 2 places. Il offre également un aménagement extérieur. Idéal pour ceux qui ne sont pas à l’aise pour conduire un “gros” van aménagé.', 99),
	(10, 2, 'RENAULT Trafic Hanroad', 5, 'Le van aménagé made in France Renault Trafic Hanroad vous offrira beaucoup de place pour ranger et vous reposer avec ses 5 places assises et ses 5 couchages (2 adultes + 3 enfants).', 129),
	(11, 3, 'FORD Transit Nugget', 5, 'Le van aménagé FORD Transit Nugget vous offrira beaucoup de place pour ranger et vous reposer avec ses 5 places assises et ses 5 couchages (2 adultes + 3 enfants).', 129);
